fter a certain time, or stream all of the data.  This will allow others to work with the data to do analysis.','How do I publish my data? (Press "Publish" on "Submissions" -> "Filter Submissions" or on "Form Management" -> "Forms List")<br>&nbsp;1.  Choose whether you want your data in a Google Fusion Table or a Google Spreadsheet.<br>&nbsp;2a.  If you chose Google Fusion Table:<br>&nbsp;&nbsp;a.  Choose whether you would like to upload only, stream only, or both.<br>&nbsp;&nbsp;&nbsp;1.  Upload only - This will take the current table and send it to the service.  No new data will be sent.<br>&nbsp;&nbsp;&nbsp;2.  Stream only - This will only send new data after the service is created.  No old data will be sent.&nbsp;&nbsp;&nbsp;3.  Both will send both old and new data.<br>&nbsp;&nbsp;b.  Press "Publish".<br>&nbsp;&nbsp;c.  Press "Grant Access" so that ODK Aggregate is allowed to make the file.<br>&nbsp;&nbsp;d.  You can view your published document in Google Fusion Tables.<br>&nbsp;2b.  If you chose Google Spreadsheet:<br>&nbsp;&nbsp;a.  Enter the desired name of the spreadsheet.<br>&nbsp;&nbsp;b.  Choose whether you would like to upload only, stream only, or both.<br>&nbsp;&nbsp;&nbsp;1.  Upload only - This will take the current table and send it to the service.  No new data will be sent.<br>&nbsp;&nbsp;&nbsp;2.  Stream only - This will only send new data after the service is created.  No old data will be sent.<br>&nbsp;&nbsp;&nbsp;3.  Both will send both old and new data.<br>&nbsp;&nbsp;c.  Press "Publish".<br>&nbsp;&nbsp;d.  Press "Grant Access" so that ODK Aggregate is allowed to make the file.<br>&nbsp;&nbsp;e.  You can view your published document in Google Docs.');G3b=new O3b('HELP',7,'Help','http://www.youtube.com/embed/Y9kmJeMpY38','Aggregate provides three kinds of help accessible by pressing one of three buttons in the upper righthand corner.',"&nbsp;1.  The red question mark will give you instructions for the tab you are currently viewing. When you click the button, a help panel will appear at the bottom of the screen. To hide the help panel, simply click the red question mark again. <br>&nbsp;2.  The green book will give you the most comprehensive help.  When you click the button, a popup will appear providing detailed information as well as video instruction.<br>&nbsp;3.  The blue balloon increases the amount of detail that appears that describes the button's functionality when you hover over most buttons.<br>");I3b=new O3b(cnc,8,dnc,null,Ndc,Ndc);D3b=lA($S,rcc,191,[M3b,K3b,F3b,H3b,L3b,E3b,J3b,G3b,I3b])}
